    <p>{`Once the dependencies and the libraries are installed, you can use the software.
To use it, simply ope the Jupyter Notebook, and sequentially run and execute each cell.
In the last cell, you will be prompted to choose a batch number and a sample so you can choose one of the validation photos and see the models output and results.`}</p>
